// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract TBILLToken is ERC20 {

    mapping(address => uint256) private _balances;

    constructor() ERC20("TBILL Token", "TBILL") {
        _mint(msg.sender, 1000000000 * 10 **(decimals()));
    }

    function mint(address account, uint256 amount) external {
        _mint(account, amount);
    }

    function burn(address account, uint256 amount) external {
        _burn(account, amount);
    }

    // Function to retrieve all tokens owned by a specific address
    function getBalance(address account) external view returns (uint256) {
        return _balances[account];
    }
}

contracts/TbillVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./TBILLToken.sol";
import "./SafeMath.sol";

contract TbillVault is ReentrancyGuard {

    using SafeMath for uint256;
    TBILLToken tToken;
    address public owner;
    ERC20 public cUSDToken;
    uint256 public cToken;
    uint256 public liquidityToken;
    uint256 public yieldRate = 5 * 10 ** 16; // 0.5% represented in 18 decimal places
    uint256 public constant maturityDuration = 30 days;
    uint256 public constant maturityDuration1 = 90 days;
    uint256 public constant maturityDuration2 = 180 days;

    // Define a struct to hold staking information
    struct Staker {
        uint256 stakedAmount;
        uint256 yieldEarned;
        uint256 lastYieldUpdate;
        uint256 liquidityToken;
        uint256 duration; // New field to hold stake duration
        uint256 yield; // New field to hold yield
        uint256 stakeValueAmount; // New field to hold stake value amount
        uint256 amountToReceive; // New field to hold amount to receive yield
        uint256 stakeTimestamp; // New field to hold the timestamp of the stake
    }

    // Define three maps to hold stakes for different durations
    mapping(address => Staker) public stakers1M;
    mapping(address => Staker) public stakers3M;
    mapping(address => Staker) public stakers6M;

    // Define arrays to hold staker addresses for each maturity duration
    address[] public stakerAddresses1M;
    address[] public stakerAddresses3M;
    address[] public stakerAddresses6M;
    mapping(address => mapping(address => uint256)) public allowances;

    event Staked(address indexed account, uint256 amount, uint256 liquidityTokens, uint256 stakingTokensMinted);
    event Withdrawn(address indexed account, uint256 amount, uint256 penaltyFee, uint256 yieldEarned);
    event YieldUpdated(uint256 newRate);
    event Approval(address indexed owner, address indexed spender, uint256 value); // Event for Approval

    constructor(address _tbillToken, address _cUSDToken) {
        tToken = TBILLToken(_tbillToken);
        cUSDToken = ERC20(_cUSDToken); // Initialize cUSD token contract
        owner = msg.sender; // Set the deployer as the owner
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    // Stake function modified to accept yield, stake value amount, amount to receive, and duration
    function stake(uint256 _yield, uint256 _stakeValueAmount, uint256 _amountToReceive, uint256 _duration) external payable nonReentrant {
        require(_amountToReceive > 0, "Amount to receive must be greater than zero");
        require(_stakeValueAmount > 0, "Stake value amount must be greater than zero");
        require(_yield > 0, "Yield must be greater than zero");
        require(_duration == maturityDuration || _duration == maturityDuration1 || _duration == maturityDuration2, "Invalid stake duration");

        // Transfer cUSD tokens from user to this contract
        require(cUSDToken.transferFrom(msg.sender, address(this), _stakeValueAmount), "cUSD transfer failed");

        // Update staker's state based on duration
        Staker storage staker;
        if (_duration == maturityDuration) {
            staker = stakers1M[msg.sender];
        } else if (_duration == maturityDuration1) {
            staker = stakers3M[msg.sender];
        } else {
            staker = stakers6M[msg.sender];
        }

        staker.stakedAmount = staker.stakedAmount.add(_stakeValueAmount);
        staker.lastYieldUpdate = block.timestamp;
        staker.duration = _duration;
        staker.yield = _yield;
        staker.stakeValueAmount = _stakeValueAmount;
        staker.amountToReceive = _amountToReceive;
        staker.stakeTimestamp = block.timestamp;

        // Mint staking tokens
        tToken.mint(msg.sender, _stakeValueAmount);

        // Add staker address to the respective array
        addStakerAddress(_duration, msg.sender);

        // Emit event
        emit Staked(msg.sender, _stakeValueAmount, 0, _stakeValueAmount);
    }

    function withdraw(uint256 _duration) external nonReentrant {
    Staker storage staker;
    if (_duration == maturityDuration) {
        staker = stakers1M[msg.sender];
    } else if (_duration == maturityDuration1) {
        staker = stakers3M[msg.sender];
    } else {
        staker = stakers6M[msg.sender];
    }

    require(staker.stakedAmount > 0, "No stake exists for the user");

    // Check if the stake duration has completed
    require(block.timestamp >= staker.stakeTimestamp + staker.duration, "Stake duration not completed");

    // Calculate yield
    uint256 yield = calculateYield(staker.stakedAmount, staker.lastYieldUpdate);

    // Calculate total amount to transfer
    uint256 totalAmount = staker.amountToReceive + yield;

    // Calculate penalty fee (0.15% of the staked amount)
    uint256 penaltyFee = staker.stakedAmount * 15 / 10000;

    // Subtract the penalty fee
    totalAmount -= penaltyFee;

    // Transfer the total amount to the user
    require(cUSDToken.transfer(msg.sender, totalAmount), "Transfer failed");

    // Reset staker state
    staker.stakedAmount = 0;
    staker.yieldEarned = 0;
    staker.lastYieldUpdate = 0;
    staker.duration = 0;
    staker.yield = 0;
    staker.stakeValueAmount = 0;
    staker.amountToReceive = 0;
    staker.stakeTimestamp = 0;

    // Remove staker address from the respective array
    removeStakerAddress(_duration, msg.sender);

    // Emit event
    emit Withdrawn(msg.sender, totalAmount, penaltyFee, yield);
}

    function calculateYield(uint256 initialStakedAmount, uint256 lastUpdateTimestamp) internal view returns (uint256) {
        uint256 stakedDuration = block.timestamp - lastUpdateTimestamp;
        if (stakedDuration >= maturityDuration) {
            return initialStakedAmount * yieldRate * stakedDuration / 1 days;
        }
        return 0;
    }

    function calculateAndUpdateYield(Staker storage staker) internal nonReentrant {
        require(staker.stakedAmount > 0, "Staker does not exist");

        uint256 yieldEarned = calculateYield(staker.stakedAmount, staker.lastYieldUpdate);
        staker.yieldEarned = staker.yieldEarned.add(yieldEarned);
        staker.lastYieldUpdate = block.timestamp;
    }

    function getStakerByDuration(address stakerAddress, uint256 duration) internal view returns (Staker storage) {
        if (duration == maturityDuration) {
            return stakers1M[stakerAddress];
        } else if (duration == maturityDuration1) {
            return stakers3M[stakerAddress];
        } else {
            return stakers6M[stakerAddress];
        }
    }

    // Add staker address to the respective array
    function addStakerAddress(uint256 duration, address stakerAddress) internal {
        if (duration == maturityDuration) {
            stakerAddresses1M.push(stakerAddress);
        } else if (duration == maturityDuration1) {
            stakerAddresses3M.push(stakerAddress);
        } else {
            stakerAddresses6M.push(stakerAddress);
        }
    }
    function getStakesByAddress(address stakerAddress) external view returns (Staker[] memory) {
    uint256 totalStakes = stakerAddresses1M.length + stakerAddresses3M.length + stakerAddresses6M.length;
    Staker[] memory result = new Staker[](totalStakes);
    uint256 index = 0;

    for (uint256 i = 0; i < stakerAddresses1M.length; i++) {
        if (stakerAddresses1M[i] == stakerAddress) {
            result[index] = stakers1M[stakerAddress];
            index++;
        }
    }

    for (uint256 i = 0; i < stakerAddresses3M.length; i++) {
        if (stakerAddresses3M[i] == stakerAddress) {
            result[index] = stakers3M[stakerAddress];
            index++;
        }
    }

    for (uint256 i = 0; i < stakerAddresses6M.length; i++) {
        if (stakerAddresses6M[i] == stakerAddress) {
            result[index] = stakers6M[stakerAddress];
            index++;
        }
    }

    return result;
}
function getPurchasedTBillsByAddress(address stakerAddress) external view returns (uint256) {
    return tToken.balanceOf(stakerAddress);
}

   // Remove staker address from the respective array
    function removeStakerAddress(uint256 duration, address stakerAddress) internal {
        if (duration == maturityDuration) {
            removeAddress(stakerAddresses1M, stakerAddress);
        } else if (duration == maturityDuration1) {
            removeAddress(stakerAddresses3M, stakerAddress);
        } else {
            removeAddress(stakerAddresses6M, stakerAddress);
        }
    }

    // Remove staker address from array
    function removeAddress(address[] storage array, address addressToRemove) internal {
        for (uint256 i = 0; i < array.length; i++) {
            if (array[i] == addressToRemove) {
                array[i] = array[array.length - 1];
                array.pop();
                break;
            }
        }
    }

    function approve(address spender, uint256 amount) external returns (bool) {
        allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool) {
        require(allowances[sender][msg.sender] >= amount, "Insufficient allowance");
        allowances[sender][msg.sender] -= amount;
        _transfer(sender, recipient, amount);
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal {
        require(sender != address(0), "Transfer from the zero address");
        require(recipient != address(0), "Transfer to the zero address");

        uint256 senderBalance = cUSDToken.balanceOf(sender);
        require(senderBalance >= amount, "Insufficient balance");

        cUSDToken.transfer(recipient, amount);
    }
}

